import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App=()=>{

 const [num , setnum]=useState(0);
const event=()=>{
    
    setnum(num+1);
}
useEffect(()=>{
    document.title.innerHTML=`hello indian +${num}`;
})

    return (<>
        <h1>hello india</h1>
        <button onClick={event}>this is me , indian{num}</button>

    </>)
}
export default App;
